intro:
- 16 years of experience in SQA for desktop, web and back office applications.- 12 years of working in projects with international teams distributed in different locations all over the world.- Good understanding of software application development and defect lifecycles.- Experience of performing testing projects/testing cycles from receiving requirements till sign-off.- Experience and understanding of testing, the test life cycle, the different types of test approaches and methodologies (Agile, Waterfall, V-model).- Experience in analysis of business and technical requirements / creating test documentation (test cases, test plans, test strategy).Core skills:Senior QA Engineer in large and medium scale projects in the financial services industry involving all types of black-box testing (functional, regression, integration, performance, smoke, user acceptance testing etc.), gray-box testing using MS SQL Server and Oracle SQL Developer, OMS testing, FIX protocol, test development, GUI-based testing, backend testing, performance testing, testing of the data from financial markets and exchanges.Software platforms and technologies:- OS: Windows, Unix;- Software: Perfmon, Microsoft Office/Excel;- Database management systems: Microsoft SQL Server 2005/2008, Oracle SQL Developer;- Languages: SQL, Java, Python, C++ Builder, Delphi;- Scripting: VBA, VB Script, Perl;- Unix command line, bash scripting;- BTSs: TFS, HP Quality Center, JIRA, CollabNet;- ALM (test plans/test cases).- 16 years of experience in SQA for desktop, web and back office applications.
- 12 years of working in projects with international teams distributed in different locations all over the world.
- Good understanding of software application development and defect lifecycles.
- Experience of performing testing projects/testing cycles from receiving requirements till sign-off.
- Experience and understanding of testing, the test life cycle, the different types of test approaches and methodologies (Agile, Waterfall, V-model).
- Experience in analysis of business and technical requirements / creating test documentation (test cases, test plans, test strategy).

Core skills:
Senior QA Engineer in large and medium scale projects in the financial services industry involving all types of black-box testing (functional, regression, integration, performance, smoke, user acceptance testing etc.), gray-box testing using MS SQL Server and Oracle SQL Developer, OMS testing, FIX protocol, test development, GUI-based testing, backend testing, performance testing, testing of the data from financial markets and exchanges.

Software platforms and technologies:
- OS: Windows, Unix;
- Software: Perfmon, Microsoft Office/Excel;
- Database management systems: Microsoft SQL Server 2005/2008, Oracle SQL Developer;
- Languages: SQL, Java, Python, C++ Builder, Delphi;
- Scripting: VBA, VB Script, Perl;
- Unix command line, bash scripting;
- BTSs: TFS, HP Quality Center, JIRA, CollabNet;
- ALM (test plans/test cases).

